sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcds = new GoogleCloudDatastoreUtils();
    gcds.validateInputVariables(inputs, outputs);
    gcds.validateMandatoryVariables(inputs, ['projectid', 'bucketname']);
    gcds.maptoOutputFromInput(inputs, outputs, ['projectid']);
    gcds.entityExport(inputs, outputs, "Export");
})(inputs, outputs);

